import styled from 'styled-components';

export const Container = styled.div`

    display: grid;
    position: relative;
    grid-template-columns: repeat(3, 1fr);
    gap: 1.5rem;
    top: -10rem;
    header {
        display: flex;
        justify-content: space-between;
    }
`;
